package datatypes;

public class RelationalOperations {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
		//<
		
		int num1=1;
		int num2=2;
		
		boolean  op1=num1>num2;
		
		System.out.println("num1>num2 :  "+op1);
		
		//>
		
		float num3=1.2f;
		float num4=3.5f;
		
		boolean op2=num3<num4;
		
		System.out.println("num3<num4 : "+op2);
		
		//<=
		
		long num5=67*10^8l;
		long num6=67*10^8l;
		
		boolean op3=num5<=num6;
		
		System.out.println("num5<=num6 : "+op3);
		
		
		
		//>=
		
		
		double num7=5.7810678904567d;
		double num8=7.6756789934566d;
		
		boolean op4=num7>num8;
		
		System.out.println("num7>num8 : "+op4);
		
		//!=
		
		int num9=23;
		int num10=56;
		
		
		boolean op5=(num9!=num10);
		
		System.out.println("num9!=num10 : "+op5);
		
		//==
		
		float num11=6.7f;
		float num12=6.7f;
		
		
		boolean op6=(num11==num12);
		
		System.out.println("num11==num12 : "+op6);
		
		

	}

}
